(10, 'Seleccione las asignaturas y las aulas en la que se han impartido clases tanto en la primavera de 2003 como en el otoño de 2006 en el mismo edificio.', 'dobles condiciones', 'πcourse_id,room_number((σsemester = Spring∧ σyear = 2003) ∨ (σsemester= Fall ∧ σyear = 2006)(section)', 'SELECT`course_id`,`room_number` FROM section WHERE (`semester` = \'Spring\' AND `year` = 2003) OR (`semester` = \'Fall\' AND `year` = 2006) AND building = building ', '[{\"4239\": \"183\", \"course_id\": \"room_number\"}, {\"4802\": \"113\", \"course_id\": \"room_number\"}, {\"4735\": \"757\", \"course_id\": \"room_number\"}, {\"4376\": \"717\", \"course_id\": \"room_number\"}, {\"4867\": \"183\", \"course_id\": \"room_number\"}, {\"4561\": \"45\", \"course_id\": \"room_number\"}, {\"4959\": \"180\", \"course_id\": \"room_number\"}, {\"4629\": \"105\", \"course_id\": \"room_number\"}, {\"4599\": \"804\", \"course_id\": \"room_number\"}, {\"4362\": \"547\", \"course_id\": \"room_number\"}, {\"4626\": \"143\", \"course_id\": \"room_number\"}, {\"4319\": \"261\", \"course_id\": \"room_number\"}, {\"4960\": \"717\", \"course_id\": \"room_number\"}, {\"4408\": \"183\", \"course_id\": \"room_number\"}]', '0000-00-00', '2022-12-07 17:27:55', '72204533N', 'iñaki.tazon@localhost'),
(11, 'Seleccione usando subconsultas qué asignaturas se dan en un edificio que tiene un presupuesto igual a 85000.00.', 'Join', 'πcourse_id.course(σbudget.department.budget = 85000.00)(course⨝department)', 'SELECT DISTINCT course_id  FROM course INNER JOIN department WHERE department.building=(SELECT building FROM department WHERE department.budget=85000.00)', 'null', '0000-00-00', '2022-12-07 17:10:03', '72204533N', 'iñaki.tazon@localhost'),
